  /api/check-account:
    post:
      summary: ''
      operationId: postApiCheckAccount
      description: ''
      parameters: []
      responses: {  }
      tags:
        - Endpoints
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              properties:
                contact_no:
                  type: string
                  description: ''
                  example: '923001234567'
                account_type:
                  type: integer
                  description: ''
                  example: '1 for customer, 2 for waiter'
              required:
                - contact_no
                - account_type
      security: []
  /api/verify-pin:
