          required: true
          schema:
            type: integer
            description: ''
            example: 'Use for new account e.g. 923001234567'
        -
          in: query
          name: user_id
          description: ''
          example: "Don't use for new account e.g. 5"
          required: true
          schema:
            type: integer
            description: ''
            example: "Don't use for new account e.g. 5"
        -
          in: query
          name: pin_type
          description: ''
          example: 14
          required: true
          schema:
            type: integer
            description: ''
            example: 14
        -
          in: query
          name: pin
          description: ''
          example: 16
          required: true
